import React from 'react'
import "./login.css"

export default function Login() {

    const loginf = () => { 
        console.log("Clicked");
    };

  return (

    <div className='login'>
      <h1>Login Page</h1>
      <input type="text" placeholder='email'/>
      <input type="" placeholder=''/>
      <button onClick={loginf} className="btn"> Login </button>
    </div>
  )
}
